import "./reserveTutorscr.css"

import React, { useState, useEffect } from 'react';
import axios from 'axios';


function ReservationPage() {
  const [data, setData] = useState([]);

  useEffect(() => {
    async function fetchData() {
      const result = await axios(
        "https://x4g0ddpp1f.execute-api.us-east-2.amazonaws.com/prod/show/tutors"
      );
      setData(result.data.body);
    }
    fetchData();
  }, []);

  return (
    <div>
      <h1>All Reservations:</h1>
      {data.map((reservation, index) => (
        <div key={index}>
          <p>Date: {reservation.date}</p>
          <p>Time: {reservation.time}</p>
          <p>Tutor First Name: {reservation.first_name}</p>
          <p>Tutor Last Name: {reservation.last_name}</p>
          <p>Subject: {reservation.subject}</p>
        </div>
      ))}
    </div>
  );
}

export default ReservationPage;
